import React from 'react';
import { View, Text } from 'react-native';

const App: React.FC = () => {
  return (
    <View>
      <Text>Welcome to React Native!</Text>
      <Text>Welcome to React Native!</Text>
      <Text>Welcome to React Native!</Text>
      <Text>Welcome to React Native!</Text>
    </View>
  );
};

export default App;
